import React, {Component} from "react";
import MainPageService from "./MainPageService";
import Row from "antd/es/descriptions/Row";
import Col from "antd/es/grid/col";
import Card from "antd/es/card";
import Meta from "antd/es/card/Meta";
import Avatar from "antd/es/avatar";

class MainProjectList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            projectList: []
        }

    }
    componentDidMount() {
        MainPageService.getAllProjects().then(response => {
            this.setState({
                projectList: response.data
            });
            console.log(this.state.projectList)
        })
    }

    render() {
        return (
            <div className="site-card-wrapper">

                    {
                        this.state.projectList.map(
                            project  =>
                                <Card
                                    style={{ width: 300 , marginRight: 20, marginTop: 20}}
                                    cover={
                                        <img
                                            alt="example"
                                            src="https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png"
                                        />
                                    }
                                    actions={[

                                    ]}
                                >
                                    <Meta
                                        avatar={<Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />}
                                        title={project.projectName}
                                        description="Learn Python like a Professional! Start from the basics and go all the way to creating your own applications and games!"


                                    />

                                </Card>,

                        )

                    }

            </div>
        )
    }

}

export default MainProjectList;
